import React, { useState, useEffect } from "react"
import '../App.css'
import Table from 'react-bootstrap/Table';


const ShowSelectedRestaurant = () => {

  const [data, setData] = useState([]);
  try {
    axios
      .post("http://localhost:8080/restaurant/api/v1/getSelectedRestaurant/1", {
        restaurantName: data.restaurantName,
        restaurantAddedBy: data.restaurantName,
        sessionId: data.sessionId,
        statusCode: data.statusCode
      })
      .then((response) => {
        setData({
          sessionId: response.data.sessionId,
          sessionRequestedBy: response.data.sessionRequestedBy,
          message: response.data.message,
          statusCode: response.data.statusCode
        });
        console.log(response);
        console.log(response.data);
        if(response != null && response.data != null && response.data.statusCode == 200) {
          localStorage.setItem("restaurantFinderSessionId", JSON.stringify(response.data.sessionId));
        } 
      });

  } catch (error) {
    console.error("Error fetching data:", error);
    window.location = "/addUser"; //This line of code will redirect you once the submission is succeed
  }


if(data.statusCode ==200) {
  return (
    <Table striped bordered hover size="sm">
      <thead>
            <tr>
                <th>restaurantName</th>
                 <th>restaurantAddedBy</th>
                 <th>sessionId</th>
            </tr>
        </thead>
        <tbody>
            {
                 <tr key={data.restaurantName}>
                 <td>{data.restaurantName}</td>
                 <td>{data.restaurantAddedBy}</td>
                 <td>{data.sessionId}</td>
               </tr>
            }
        </tbody>
    </Table>
  );
} else {
  return (
    <Table striped bordered hover size="sm">
      <thead>
        <tr>
          <th>Message</th>
        </tr>
      </thead>

      <tbody>
        {
          <tr key={data.message}>
            <td>{data.message}</td>
          </tr>
        }
      </tbody>
    </Table>
  );
}
}
export default ShowSelectedRestaurant;
